selector_to_html = {"a[href=\"#talleres\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Talleres<a class=\"headerlink\" href=\"#talleres\" title=\"Link to this heading\">#</a></h3><p>Al igual que las conferencias, esto no representa la totalidad de talleres y\nsolo son aquellos que pude encontrar en los perfiles de github de los\norientadores de los talleres.</p>", "a[href=\"#python-software-foundation\"]": "<h4 class=\"tippy-header\" style=\"margin-top: 0;\">Python Software Foundation<a class=\"headerlink\" href=\"#python-software-foundation\" title=\"Link to this heading\">#</a></h4><p>Naomi Ceder nos invita a unirnos como\n<a class=\"reference external\" href=\"https://www.python.org/psf/membership/\">miembros</a> y\n<a class=\"reference external\" href=\"https://www.python.org/psf/sponsorship/\">patrocinadores</a> de la\nPython Software Foundation, fundaci\u00f3n encargada de velar por la propiedad\nintelectual de Python, el soporte de la infraestructura de <a class=\"reference external\" href=\"https://www.python.org\">Python.org</a>\ny <a class=\"reference external\" href=\"https://www.pypa.io/en/latest/\">PyPA</a>. Igualmente, el apoyo al desarrollo y\nparticipaci\u00f3n de eventos que promueven python y el desarrollo de software en el\nmismo. Igualmente, organiza PyCon US. Existe una membres\u00eda b\u00e1sica sin costo.</p><p>Hay una invitaci\u00f3n general a presentar propuestas para las <em>PyCon Charlas</em>,\nconferencias en la PyCon US pero en espa\u00f1ol, formato que se har\u00e1 por primera vez\neste a\u00f1o.</p>", "a[href=\"#la-experiencia-de-pycon-colombia-2018\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">La experiencia de PyCon Colombia 2018<a class=\"headerlink\" href=\"#la-experiencia-de-pycon-colombia-2018\" title=\"Link to this heading\">#</a></h1><p>Tras mi primera participaci\u00f3n en PyCon Colombia (segunda versi\u00f3n del evento), me\nencuentro con una comunidad bastante amplia y que hace honor a una de las\ncaracter\u00edsticas m\u00e1s importantes del lenguaje, y es lo extensa y variada que es\nsu comunidad. Colombia no es la excepci\u00f3n a esto.</p><p>Como cualquier evento, presenta elemento para mejorar pero se encuentra un\nequipo de organizadores dispuestos a escuchar a la comunidad para mejorar y\naprender de las dos versiones realizadas para llegar a una tercera versi\u00f3n a\u00fan\nmejor. Puedes enviar tu retroalimentaci\u00f3n a <a class=\"reference external\" href=\"mailto:feedback%40pycon.co\">feedback<span>@</span>pycon<span>.</span>co</a>.</p>", "a[href=\"#mi-participacion\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Mi participaci\u00f3n<a class=\"headerlink\" href=\"#mi-participacion\" title=\"Link to this heading\">#</a></h2><p>Que puedo decir, con lo visto en el primer d\u00eda de como las conferencias afines a\ntemas de empresa no esperaba la asistencia que finalmente tuve, y m\u00e1s a\u00fan, la\nposibilidad de continuar una comunicaci\u00f3n con interesados en el tema de python\nen educaci\u00f3n.</p><p>Mi conferencia, \u00abJupyter Notebook en el aula de clase\u00bb, fue la manera de\ncompartir mi experiencia de usar esta herramienta de distintas maneras en cursos\nque imparto o he impartido como m\u00e9todos num\u00e9ricos, herramientas computacionales,\nel uso en el semillero de f\u00edsica te\u00f3rica y computacional y en la Organizaci\u00f3n\nScalibur.</p>", "a[href=\"#taller-de-empaquetado-en-python\"]": "<h4 class=\"tippy-header\" style=\"margin-top: 0;\">Taller de empaquetado en python<a class=\"headerlink\" href=\"#taller-de-empaquetado-en-python\" title=\"Link to this heading\">#</a></h4><p>Audrey y Daniel Roy nos invitan a participar del taller de empaquetamiento que\ndirigir\u00e1n el 10 de marzo en Medell\u00edn. Igualmente, tendr\u00e1n en descuento su libro\nsobre django. El taller busca profundizar mucho m\u00e1s en el empaquetamiento (que lo\npresentado durante la conferencia) para compartir nuestros desarrollos de la manera\nm\u00e1s simple a la comunidad python.</p><p>Para poderte registrar y conocer m\u00e1s de la actividad, sigue el\n<a class=\"reference external\" href=\"https://www.meetup.com/es/Medellin-Python-y-Django-Meetup/events/247775417/?eventId=247775417\">enlace</a>.</p>", "a[href=\"#conferencias-sometidas\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Conferencias sometidas<a class=\"headerlink\" href=\"#conferencias-sometidas\" title=\"Link to this heading\">#</a></h3><p>Se presentaron una gran cantidad de conferencias y esta es solo una muestra de\naquellas que pude encontrar a trav\u00e9s de los perfiles de twitter y github de los\nconferencistas, y de los tuits compartidos durante el evento.</p>", "a[href=\"#conferencias-principales\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Conferencias principales<a class=\"headerlink\" href=\"#conferencias-principales\" title=\"Link to this heading\">#</a></h3><p>Las conferencias principales fueron en general espacios de inspiraci\u00f3n mas que\nespacios llenos de formalismo y tecnicismos. Aunque esperaba conferencias\nt\u00e9cnicas, realmente fue grato ver conferencias que permitieron realizar reflexi\u00f3n\nsobre diferentes aspectos como la inclusi\u00f3n y diversidad, la \u00e9tica y los sesgos,\ny por supuesto el romper barreras para el avance y generar nuevas revoluciones.</p><p>Es dif\u00edcil decir mucho sobre personas que solo vez en una conferencia en medio\nde muchos m\u00e1s asistentes, pero con sus charlas mostraron ser grandes personas\nadem\u00e1s del papel que desempe\u00f1an en la comunidad de python (en particular, con\nDeborah Hanus tuve la oportunidad de compartir mesa durante la cena del s\u00e1bado,\ny es una persona bastante atenta). Al poder escoger entre tantos temas,\norientarnos en como contribuir y mejorar dice mucho.</p>", "a[href=\"#recopilacion-de-material\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Recopilaci\u00f3n de material<a class=\"headerlink\" href=\"#recopilacion-de-material\" title=\"Link to this heading\">#</a></h2><p>Si bien los organizadores de PyCon Colombia compartir\u00e1n los videos de las\nconferencias en su\n<a class=\"reference external\" href=\"https://www.youtube.com/channel/UCjor6U0ZF5zGAYLJJt9gr0A\">canal</a>, hay\nmaterial accesible de las conferencias y talleres a trav\u00e9s de repositorios de\ngithub y presentaciones en sitios web personales, drive y otros servicios para\ncompartir documentos que no est\u00e1n recopiladas. Aqu\u00ed, trato de hacer seguimiento\na este importante material (puedes dejarme un comentario si conoces de un recurso\nde las conferencias y talleres que no este aqu\u00ed).</p>", "a[href=\"#id1\"]": "<figure class=\"align-center\" id=\"id1\">\n<a class=\"reference internal image-reference\" href=\"../../../../_images/pycon-colombia-2018-grupo.jpg\"><img alt=\"Foto de grupo de asistentes, conferencistas y organizadores de PyCon Colombia 2018.\" src=\"../../../../_images/pycon-colombia-2018-grupo.jpg\" style=\"width: 623.0px; height: 467.0px;\"/></a>\n<figcaption>\n<p><span class=\"caption-text\">Foto de grupo de asistentes, conferencistas y organizadores de PyCon Colombia 2018.</span><a class=\"headerlink\" href=\"#id1\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id2\"]": "<figure class=\"align-center\" id=\"id2\">\n<a class=\"reference internal image-reference\" href=\"../../../../_images/jupyter-notebook-aula-edward-villegas.jpg\"><img alt='Fotograf\u00eda del inicio de la presentaci\u00f3n de \"Usando Jupyter Notebook en el aula.\"' src=\"../../../../_images/jupyter-notebook-aula-edward-villegas.jpg\" style=\"width: 623.0px; height: 467.0px;\"/></a>\n<figcaption>\n<p><span class=\"caption-text\">Fotograf\u00eda del inicio de la presentaci\u00f3n de \u00abUsando Jupyter Notebook en el aula.\u00bb</span><a class=\"headerlink\" href=\"#id2\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
